import { createBrowserRouter, RouterProvider } from "react-router-dom";
import HomePage from "./routes/Home";

const BrowserRouter = createBrowserRouter([
  {
    path: "/",
    element: <HomePage />
  }
]);

function App() {
  return <RouterProvider router={BrowserRouter}></RouterProvider>;
}

export default App;
